inline string suffix( int n ){
  int res10 = n % 10, res100 = n % 100;
  if( res100 == 11 or res100 == 12 or res100 == 13 ) return "th";
  else if( res10 == 1 ) return "st";
  else if( res10 == 2 ) return "nd";
  else if( res10 == 3 ) return "rd";
  else return "th";
}
 
